package com.itmoprofessionals.softwaretest.lab1.util;

import com.itmoprofessionals.softwaretest.lab1.graph.model.Node;

/**
 * Generates graph
 */
public final class GraphUtil {

    /**
     * Generates sample graph
     * <p>
     * <img src="data:image/jpeg;base64," />
     * </p>
     * <p>link to graph: <a href="https://i.imgur.com/FtP3Zpi.jpeg">image</a></p>
     *
     * @return start {@link Node}
     */
    public static Node createSampleGraph() {
        Node startNode = new Node(1);
        Node node2 = new Node(2);
        Node node3 = new Node(3);
        Node node4 = new Node(4);
        Node node5 = new Node(5);

        node2.addTarget(node3, node4);
        node3.addTarget(startNode, node5);
        node4.addTarget(node2, node5);


        startNode.addTarget(node2);

        return startNode;
    }

    public static Node emptyGraph() {
        return null;
    }

    public static Node createOneNodeGraph() {
        Node startNode = new Node(1);

        return startNode;
    }

    public static Node createNoConnectiveGraph() {
        Node startNode = new Node(1);
        Node node2 = new Node(2);
        Node node3 = new Node(3);
        startNode.addTarget(node2);

        return startNode;
    }
}
